import React from "react";

export default function Intro() {
  return (
    <section id="intro">
      <container className="container mx-auto flex px-10 py-20 md:flex-row flex-col items-center">
        <div> 
          <h1>
            Hola! This is Arthy Umapathy
            <br className="hidden" /> I am software Developer and I love my
            profession.
          </h1>
        </div>
      </container>
    </section>
  );
}
